import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

const h3 = "h3h3h3";
const date = new Date();
const curDate = date.getDate();

function Card() {
  return (
    <div className="card">
      <h3>{h3}</h3>
      <h3>{curDate}</h3>
    </div>
  );
}

ReactDOM.render(
  <>
    <h1 className="styleh1">Hello React</h1>

    <Card />
  </>,
  document.getElementById("root")
);
